import React from "react";

import { images } from "../../constants";
import "./homepage.css";
import imges from "../../constants/imges";

const HomePage = () => {
  return (
    <div className="section__padding" data-aos="fade-down">
      <div className="heading__feature">
        <div className="heading__feature_logo">
          <img src={images.LOGO1} alt="logo" />
          <h1>Welcome to Sweat Smart, where fitness meets intelligence. </h1>
        </div>
        <div className="heading__feature_text">
          <div className="heading__feature-one">
            <img src={images.excercise} />
            <p>
              "Our AI-powered workout plan generator tailors each session to
              your unique goals and abilities."
            </p>
          </div>
          <div className="heading__feature-two">
            <img src={images.clock} />
            <p>
              "Our AI-powered workout plan generator tailors each session to
              your unique goals and abilities."
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
